import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="flex">
        <div id="item1">1</div>
        <div id="item2">2</div>
        <div id="item3">3</div>
        {/* <div> */}
        <div id="item4">4</div>
        <div id="item5">5</div>
        {/* </div> */}
        <div id="item6">6</div>
        <div id="item7">7</div>
        <div id="item8">8</div>
    </div>
  );
}

export default App;
